import React from "react";
import styled from "styled-components";
import Icon from "../../img/Icon.png";

const BackBlock = styled.div`
  background-color: black;
  position: absolute;
  width: 100%;
  height: 100%;
  background-size: cover;
  align-items: center;
  top: 0;
  bottom: 0;
  left: 0;
  right: 0;
`;

const MainBox = styled.div`
  background-size: #f9f9f9;
  position: absolute;
  width: 303px;
  height: 160px;
  left: 0px;
  top: 0px;
  border-radius: 0px;
`;
const IconBox = styled.div`
  background-image: url(${Icon});
  background-size: 100%;
  border-radius: 50%;
  @media (min-width: 900px) {
    margin-right: 1rem;
    margin-left: 12rem;
  }
  margin-right: 1rem;
  margin-left: 16rem;
  position: absolute;

  width: 120px;
  height: 120px;
`;

const ManageTemplate = () => {
  return <BackBlock></BackBlock>;
};

export default ManageTemplate;
